(157, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:83:\"Elementor Talks #25: How to create the Right Marketing Strategy for Your Businesses\";s:7:\"excerpt\";s:274:\"John Jantsch is a leading marketing consultant for small businesses founder of Duct Tape Marketing. In our podcast, John encourages web designers to step up their game, describes his Marketing Hourglass approach, and talks about the biggest mistake small businesses make.​\";s:7:\"created\";s:10:\"1552560848\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/podcast-25-john-jantsch/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:51:\"Introducing the Ultimate Freehand Design Experience\";s:7:\"excerpt\";s:147:\"Elementor v2.5 brings you the power of position absolute, position fixed, side-by-side widgets, Flexbox distribution & performance improvements.​\";s:7:\"created\";s:10:\"1551700888\";s:5:\"badge\";s:3:\"New\";s:3:\"url\";s:127:\"https://elementor.com/blog/introducing-flexible-layout/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:49:\"How to Create Popups in WordPress Using Elementor\";s:7:\"excerpt\";s:103:\"Learn how to use Elementor Popup Builder to design and target popups in WordPress like never before.​\";s:7:\"created\";s:10:\"1549412185\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/create-popups-wordpress/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
