(18, 1, '2019-03-15 11:07:37', '2019-03-15 14:07:37', '<h2>Estilo é tudo</h2>		\n			<h2>Vista-se Bem, Sinta-se Bem</h2>		\n		<p>Se a vida é um desfile de moda você tem de estar preparada para qualquer ocasião. Modas vão e vêm, mas tendências duram para sempre. Fuja ao padrão com a nossa coleção. Foi feita a pensar em si.</p>		\n			<a href=\"/loja\" role=\"button\">\n						Explore Nossa Loja\n					</a>\n			<h2>O estilo é algo que levamos a sério.</h2>		\n			<h2>acessórios</h2>		\n			<a href=\"#\" role=\"button\">\n						comprar agora\n					</a>\n			<h2>conheça a equipe</h2>		\n			<a href=\"#\" role=\"button\">\n						Sobre nós\n					</a>\n			<h2>tendências atuais</h2>		\n			<a href=\"#\" role=\"button\">\n						Explorar\n					</a>\n			<h2>Compre Estes Looks</h2>		\n		<p>Provavelmente não tem nada para vestir no armário</p><p style=\"text-align: center;\">Quer ver mais produtos? <a href=\"/loja\">COMPRE JÁ</a></p>		\n							<a href=\"\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Facebook\n				</a>\n							<a href=\"\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Twitter\n				</a>\n							<a href=\"\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Github\n				</a>\n							<a href=\"\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Instagram\n				</a>\n							<a href=\"\" target=\"_blank\" rel=\"noopener noreferrer\">\n					Youtube\n				</a>\n		<p style=\"text-align: center;\"><a style=\"color: #ffffff;\" href=\"/faq\">FAQ</a>    |    <a style=\"color: #ffffff;\" href=\"/politica-de-privacidade\">Política de Privacidade</a>    |    <a style=\"color: #ffffff;\" href=\"/termos-e-condicoes\">Termos e Condições</a></p><p style=\"text-align: center;\">© 2019 – Raniery</p>', 'Início', '', 'publish', 'closed', 'closed', '', 'inicio', '', '', '2019-03-27 19:53:58', '2019-03-27 22:53:58', '', 0, 'http://localhost/?page_id=18', 0, 'page', '', 0),
